class Solution:
    def maxProduct(self, nums: List[int]) -> int:
        if len(nums)==1:
            return nums[0]
        ans=0
        maxPositive=0
        maxNegative=0
        for val in nums:
            if val>0:
                maxPositive=max(maxPositive*val,val)
                if maxNegative:
                    maxNegative=maxNegative*val
                else:
                    maxNegative=0
            elif val<0:
                tempVal=maxPositive
                if maxNegative:
                    maxPositive=maxNegative*val
                else:
                    maxPositive=0
                
                maxNegative=min(tempVal*val,val)
            elif val==0:
                maxNegative=0
                maxPositive=0
            
            ans=max(maxPositive,ans)
        return ans

